v.x:
var $bm_rt;
var transComplete, startAngle, endAngle, spiralSize, flightWarp, x_offset, y_offset, scaledOffset;
transComplete = effect('Zoom - spirale')('Completamento transizione');
startAngle = $bm_sub(effect('Zoom - spirale')('Angolo iniz. spirale (gradi)'), 90);
endAngle = $bm_sub(effect('Zoom - spirale')('Angolo finale spirale (gradi)'), 90);
spiralSize = effect('Zoom - spirale')('Dimensione spirale (pixel)');
flightWarp = degreesToRadians(linear(transComplete, 0, 100, startAngle, endAngle));
x_offset = Math.cos(flightWarp);
y_offset = Math.sin(flightWarp);
scaledOffset = linear(transComplete, 0, 100, spiralSize, 0);
$bm_rt = $bm_sum([
    thisLayer.width / 2,
    thisLayer.height / 2
], $bm_mul([
    x_offset,
    y_offset
], scaledOffset));

var $bm_rt;
var transComplete;
transComplete = effect('Zoom - spirale')('Completamento transizione');
$bm_rt = linear(transComplete, 0, 100, 0, 100);
